sources.components/Footer.js:
import Psk from "../../../src"
const { createElement } = Psk;


class Footer extends Psk.Component {
    constructor(props, stateManager) {
        super(props, stateManager);
    }

    renderClearCompletedButton() {
        const { todos, clearCompleted } = this.props;
        const completedExists = todos.some(todo => todo.completed);

        return completedExists ? createElement('button', {
            class: 'clear-completed',
            onclick: clearCompleted
        }, 'Clear completed') : null;
    }

    renderFilterLink(filterName) {
        const { setFilter, currentFilter } = this.props;
        const className = filterName === currentFilter ? 'selected' : '';

        return createElement('li', {},
            createElement('a', {
                href: '#/',
                class: className,
                onclick: () => setFilter(filterName)
            }, filterName.charAt(0).toUpperCase() + filterName.slice(1))
        );
    }

    update() {
        this.props.update();
    }

    render() {
        const { todos } = this.props;
        const itemsLeft = todos.filter(todo => !todo.completed).length;

        return createElement('footer', { class: 'footer' }, [
            createElement('span', { class: 'todo-count' }, `${itemsLeft} item${itemsLeft !== 1 ? 's' : ''} left`),
            createElement('ul', { class: 'filters' }, [
                this.renderFilterLink('all'),
                this.renderFilterLink('active'),
                this.renderFilterLink('completed')
            ]),
            this.renderClearCompletedButton()
        ]);
    }
}

export default Footer;
